(2, '1%2F1+fdafdafda', 'dsfds+fd', 'fddds+a123+1fd32a+13f', '%3Cp%3E%3Cstrong%3ESize%3A%C2%A0%3C%2Fstrong%3ESample%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%C2%A0%3C%2Fstrong%3E37%25+Cotton%2F55%25+Polyester%2F5%25+Viscose%2F3%25+Other+Fibers%3C%2Fp%3E%3Cp%3EHedi+Slimane%C3%A2%E2%82%AC%E2%84%A2s+SS16+%C3%A2%E2%82%AC%C5%93Surf+Sound%C3%A2%E2%82%AC%C2%9D+collection+was+inspired+by+Californian+surf+culture%2C+incorporating+elements+of+the+landscape+and+musical+scene.+This+souvenir+jacket+features+a+vibrant+sunset+print+on+the+body+featuring+palm+trees+and+the+ocean+in+tones+of+orange+and+red.+Opulent+gold+piping+runs+along+the+sleeves%2C+complementing+the+%C3%A2%E2%82%AC%CB%9Cglittery%C3%A2%E2%82%AC%E2%84%A2+ribbing+inserts+on+the+cuffs%2C+hem%2C+and+neck.+This+iteration+is+a+1%2F1+sample+produced+for+Hedi%C3%A2%E2%82%AC%E2%84%A2s+atelier.%3C%2Fp%3E%3Cp%3EFits+44-46.%C2%A0%3C%2Fp%3E', '12,30,32,33,34,35,38,39,45,', 'http://192.168.1.40/2_team/1_pae/3_gridview/angular/adm/upload/01531706657.jpg,http://192.168.1.40/2_team/1_pae/3_gridview/angular/adm/upload/11531706657.jpg,https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a87d2a824a694d70788270e/1518850737597/DSC06373.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a8777d008522933c2ab02cd/1518827481524/DSC06374.jpg', 'PHYSICAL', '', 'SQ9669936', '', '', '', '', '', '', '0', '0'),
(3, '68+Denim', '', '', '%3Cp%3E%3Cstrong%3ESize%3A+%3C%2Fstrong%3E1+%2B+3%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%C2%A0%3C%2Fstrong%3E100%25+Cotton%3C%2Fp%3E%3Cp%3EThe+%C3%A2%E2%82%AC%C5%9368%C3%A2%E2%82%AC%C2%9D+denim+are+amongst+the+most+coveted+pieces+from+Jun+Takahashi%C3%A2%E2%82%AC%E2%84%A2s+Undercover+label.+While+they+were+first+introduced+in+AW04%2C+this+pair+is+a+reissue+from+the+SS10+collection%2C+and+captures+all+the+details+of+the+original%3B+from+the+heavily+frayed+pockets+and+cuffs%2C+to+the+shredded+knees.+A+subtle+embroidered+lightning+bolt+is+seen+on+the+left+knee%2C+a+reference+to+Patti+Smith%2C+one+of+Takahashi%C3%A2%E2%82%AC%E2%84%A2s+idols.+Additionally%2C+the+signature+yarn+detailing+of+68+denim+is+seen+here+in+a+vibrant+cobalt+blue.%3C%2Fp%3E%3Cp%3EFit+is+slim+through+the+leg.%C2%A0%3C%2Fp%3E', '13,24,30,32,33,34,35,38,39,45,', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e1c53450aea171f25df/5a668ee48165f59d849d1a72/1525908157153/DSC03120-162.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e1c53450aea171f25df/5a668ee4f9619a21f7731263/1525908157156/DSC03122-163.jpg', 'PHYSICAL', '', 'SQ5968718', '', '', '', '', '', '', '0', '0'),
