(5, '68+Denim+', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E1%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Cotton%3C%2Fp%3E%3Cp%3EThe+%C3%A2%E2%82%AC%C5%9368%C3%A2%E2%82%AC%C2%9D+denim+are+amongst+the+most+coveted+pieces+from+Jun+Takahashi%C3%A2%E2%82%AC%E2%84%A2s+Undercover+label.+While+they+were+first+introduced+in+AW04%2C+this+pair+is+a+reissue+from+the+SS10+collection%2C+and+captures+all+the+details+of+the+original%3B+from+the+heavily+frayed+pockets+and+cuffs%2C+to+the+shredded+knees.+A+subtle+embroidered+lightning+bolt+is+seen+on+the+left+knee%2C+a+reference+to+Patti+Smith%2C+one+of+Takahashi%C3%A2%E2%82%AC%E2%84%A2s+idols.+Additionally%2C+the+signature+yarn+detailing+of+68+denim+is+seen+here+in+a+light+powder+blue.%3C%2Fp%3E%3Cp%3EFit+is+slim+through+the+leg.%26nbsp%3B%3C%2Fp%3E', '29', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e1c53450aea171f25df/5a8cc15371c10b2aca3b179d/1519173983850/DSC06408.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e1c53450aea171f25df/5a8cc181085229f9123a4153/1519174029082/DSC06412.jpg', 'PHYSICAL', '', 'SQ0501996', '', '', '', '', '', '', '0', '0'),
(6, '85+Denim', '', '', '%3Cp%3E%3Cstrong%3ESize%3A+%3C%2Fstrong%3E1%2F2%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Cotton%3C%2Fp%3E%3Cp%3ENo+garment+encapsulates+Jun+Takahashi%C3%A2%E2%82%AC%E2%84%A2s+punk+oriented+design+sensibilities+and+attention+to+detail+quite+like+the+%C3%A2%E2%82%AC%C5%9385%C3%A2%E2%82%AC%C2%9D+denim+from+the+AW05+%C3%A2%E2%82%AC%C5%93Arts+and+Crafts%C3%A2%E2%82%AC%C2%9D+collection.+The+black+denim+features+heavy+distressing+all+over%2C+making+it+appear+as+though+the+garment+is+on+the+verge+of+falling+apart+at+its+seams.+A+subtle+embroidered+lightning+bolt+is+seen+on+the+left+knee%2C+a+reference+to+Patti+Smith%2C+one+of+Takahashi%C3%A2%E2%82%AC%E2%84%A2s+idols.%3C%2Fp%3E%3Cp%3EFit+is+slim+through+the+leg.%26nbsp%3B%3C%2Fp%3E', '12', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e1c53450aea171f25df/5a930e4924a69489a713f278/1519586896098/artifact_ny_0225_-10.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e1c53450aea171f25df/5a930e49f9619a83af4c48c7/1519586895853/artifact_ny_0225_-11.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e1c53450aea171f25df/5a930e4f085229b264d2e1dd/1519586903302/artifact_ny_0225_-12.jpg', 'PHYSICAL', '', 'SQ6230922', '', '', '', '', '', '', '0', '0'),
(7, '85+Denim', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E2%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Cotton%26nbsp%3B%3C%2Fp%3E%3Cp%3ENo+garment+encapsulates+Jun+Takahashi%C3%A2%E2%82%AC%E2%84%A2s+punk+oriented+design+sensibilities+and+attention+to+detail+quite+like+the+%C3%A2%E2%82%AC%C5%9385%C3%A2%E2%82%AC%C2%9D+denim+from+the+AW05+%C3%A2%E2%82%AC%C5%93Arts+and+Crafts%C3%A2%E2%82%AC%C2%9D+collection.+The+blue+denim+features+heavy+distressing+all+over%2C+making+it+appear+as+though+the+garment+is+on+the+verge+of+falling+apart+at+its+seams.+A+subtle+embroidered+lightning+bolt+is+seen+on+the+left+knee%2C+a+reference+to+Patti+Smith%2C+one+of+Takahashi%C3%A2%E2%82%AC%E2%84%A2s+idols.%3C%2Fp%3E%3Cp%3EFit+is+slim+through+the+leg.%26nbsp%3B%3C%2Fp%3E', '24', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e1c53450aea171f25df/5a930e6a0d9297895c937c90/1519586929744/artifact_ny_0225_-6.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e1c53450aea171f25df/5a930e6a085229b264d2e8c7/1519586929775/artifact_ny_0225_-7.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e1c53450aea171f25df/5a930e71c830257a347bd6ec/1519586942455/artifact_ny_0225_-8.jpg', 'PHYSICAL', '', 'SQ6829418', '', '', '', '', '', '', '0', '0'),
(8, 'Hawaiian+Print+Shirt+', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E38%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Cotton%3C%2Fp%3E%3Cp%3EWhile+Hedi+Slimane+has+often+incorporated+elements+of+the+Californian+surfer+aesthetic+in+his+work%2C+his+SS16+%C3%A2%E2%82%AC%C5%93Surf+Sound%C3%A2%E2%82%AC%C2%9D+collection+consisted+almost+entirely+of+surfer+inspired+pieces%2C+and+this+short+sleeved+cotton%2Flinel+blend+Hawaiian+shirt+is+one+such+garment.+It+features+a+black+and+white+palm+tree+print%2C+as+well+as+a+camp+collar+that+is+reminiscent+of+vintage+Hawaiian+shirts%3Cstrong%3E.%3C%2Fstrong%3E%3C%2Fp%3E%3Cp%3EFits+true+to+size.%26nbsp%3B%3C%2Fp%3E', '12', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a6694af0d92971bebc637b3/1516672198201/DSC03214.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a6694af0852299e7993b586/1516672197098/DSC03215.jpg', 'PHYSICAL', '', 'SQ8307719', '', '', '', '', '', '', '0', '0'),
(9, 'A+Tribe+Called+Quest+%22Maurauders%22', '', '', '%3Cp%3E%3Cstrong%3EMeasurement%3A%26nbsp%3B%3C%2Fstrong%3E21%2F28%3C%2Fp%3E%3Cp%3E%3Cstrong%3EYear%3A%26nbsp%3B%3C%2Fstrong%3E1993+%3C%2Fp%3E%3Cp%3EOnly+hardcore+collectors+are+ever+privileged+enough+to+see+let+alone+buy+a+piece+of+music+history+like+Tribe+tees+out+in+the+wild.+Our+%C3%A2%E2%82%AC%CB%9CMarauders%C3%A2%E2%82%AC%E2%84%A2+tee+dates+back+to+93%C3%A2%E2%82%AC%E2%84%A2+when+it+all+began.+What+was+once+black+has+now+washed+grey%2C+paper+thin+and+super+soft.+GOAT.%3C%2Fp%3E', '29', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e610852298a122b079a/5a877dedc83025f59a41cf03/1518829044619/DSC06364.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e610852298a122b079a/5a877df2e2c4831ac9001e5e/1518829049293/DSC06365.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e610852298a122b079a/5a66b56d24a69492e7c3313d/1516680613393/Wu+Tang+Clan+%2522Forever%2522+-95.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e610852298a122b079a/5a66b56df9619a21f77c37fe/1516680625608/Wu+Tang+Clan+%2522Forever%2522+-96.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e610852298a122b079a/5a66b59f71c10bf8dff5751f/1518829028199/Wu+Tang+Clan+%2522Forever%2522+-97.jpg', 'PHYSICAL', '', 'SQ9812989', '', '', '', '', '', '', '0', '0'),
