(29, 'Bleached+Bondage+Muslin+Top', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E50%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3ECotton+Blend%26nbsp%3B%3C%2Fp%3E%3Cp+style%3D%22margin-left%3A0px%3B+margin-right%3A0px%22%3ERaf+Simons%C3%A2%E2%82%AC%E2%84%A2+SS98+%C3%A2%E2%82%AC%C5%93Black+Palms%C3%A2%E2%82%AC%C2%9D+referenced+several+elements+of+punk+culture%2C+with+the+most+blatant+being+a+Sex+Pistols+album+cover+on+a+tank+top.+A+mainstay+of+the+collection+was+a+bleached+red%2Fwhite+pattern+that+was+seen+on+several+garments%2C+including+this+bondage+style+pullover.+The+top+is+inspired+by+Vivienne+Westwood%C3%A2%E2%82%AC%E2%84%A2s+straitjacket+shirts+from+the+70s%2C+which+featured+similar+elongated+sleeves+with+buckles+at+the+end.+The+shoulder+cutouts+include+Velcro+tabs%2C+while+the+hem+has+an+extended+second+layer%2C+with+raw+hems+along+the+sides.%3C%2Fp%3E%3Cp%3EFits+true+to+size.%26nbsp%3B%3C%2Fp%3E', '29', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a8773d5e4966ba44faa1444/1518826463433/DSC06537.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a8773e09140b7effc97cf2f/1518826495949/DSC06538.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a8773e053450a6552c093de/1518826501758/DSC06540.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a8773fbec212d1cb44d84af/1518826502498/DSC06541.jpg', 'PHYSICAL', '', 'SQ7031756', '', '', '', '', '', '', '0', '0'),
(30, 'Blowout+Denim', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E31%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E98%25+Cotton%2F2%25+Elastane%3C%2Fp%3E%3Cp%3EThe+appeal+of+Hedi+Slimane%C3%A2%E2%82%AC%E2%84%A2s+denim+at+Saint+Laurent+lies+in+the+naturally+worn+in+nature+of+the+distressing.+Most+designer%C3%A2%E2%82%AC%E2%84%A2s+attempts+at+creating+authentic+looking+distressing+lead+to+garments+that+appear+thoroughly+contrived%2C+however+Slimane%C3%A2%E2%82%AC%E2%84%A2s+work+is+anything+but.+This+pair+of+heavily+washed+knee+blowout+denim+from+his+AW13+collection+is+one+of+the+most+coveted+pieces+from+his+tenure%2C+cut+in+the+house%C3%A2%E2%82%AC%E2%84%A2s+staple+D02+skinny+fit.%3C%2Fp%3E%3Cp%3EFits+skinny+through+the+leg.%26nbsp%3B%3C%2Fp%3E', '22', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a668e03e2c48352fcbdaca8/1521854066066/DSC03115-158.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a668e0324a69492e7b9d1f7/1521854066073/DSC03116-159.jpg', 'PHYSICAL', '', 'SQ4451596', '', '', '', '', '', '', '0', '0'),
