(121, 'Metal+Aviator+Chaps+', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E44%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Nylon%26nbsp%3B%3C%2Fp%3E%3Cp+style%3D%22margin-left%3A0px%3B+margin-right%3A0px%22%3EBondage+has+remained+a+consistent+theme+throughout+Lang%C3%A2%E2%82%AC%E2%84%A2s+work%2C+with+elements+being+woven+into+even+his+most+pared+down+garments.+These+aviator+chaps%2C+while+being+far+from+pared+down%2C+are+a+testament+to+Lang%C3%A2%E2%82%AC%E2%84%A2s+ability+to+not+limit+himself.+The+body+is+comprised+of+100%25+polyester+with+a+wrinkly+texture%2C+a+detail+that+was+seen+on+other+garments+from+AW03+as+well.+The+waist+includes+a+hefty+metal+tipped+rope%2C+as+well+as+zippers+on+the+side+of+the+leg.%3C%2Fp%3E%3Cp%3EFits+relaxed.%26nbsp%3B%3C%2Fp%3E', '13', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dc7e2c483af0b069004/5a930deb4192029593639a77/1520037190299/artifact_ny_0225_-13.jpg', 'PHYSICAL', '', 'SQ4557608', '', '', '', '', '', '', '0', '0'),
(122, 'Metal+Blend+Bondage+Bomber', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E46%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E78%25+Nylon%2F22%25+Metal%3C%2Fp%3E%3Cp+style%3D%22margin-left%3A0px%3B+margin-right%3A0px%22%3EHelmut+Lang%C3%A2%E2%82%AC%E2%84%A2s+2003+collection+included+perhaps+his+most+copied+garment.+This+bomber+jacket+with+bondage+details+has+inspired+a+plethora+of+imitations%2C+yet+none+come+close+to+the+original%2C+primarily+because+of+Lang%C3%A2%E2%82%AC%E2%84%A2s+attention+to+detail.+While+being+similar+to+a+traditional+MA-1+jacket%2C+it+comes+with+all+the+trimmings+expected+from+Lang.+A+black+nylon%2Fmetal+blend+is+used+in+this+iteration%2C+with+the+slight+stiffness+creating+a+pleasing+crinkled+texture.+The+zipper+tape+on+the+front+is+extended+past+the+hem%2C+with+ribbed+inserts+made+of+wool+on+the+cuffs+and+hem.+Bondage+detailing+is+seen+on+both+cuffs%2C+in+addition+to+two+on+the+rear+hem.+The+straps+include+2+coated+rectangular+buckles%2C+allowing+the+wearer+to+modify+the+length+and+customize+the+fit.%3C%2Fp%3E%3Cp%3EFits+true+to+size.%26nbsp%3B%3C%2Fp%3E', '21', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dc7e2c483af0b069004/5a6677ce08522976add04bd9/1516664801165/DSC02805-47.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dc7e2c483af0b069004/5a6677ce71c10bc1c17cdaff/1516664803189/DSC02807-48.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dc7e2c483af0b069004/5a6677de08522976add052ad/1516664819286/DSC02808-49.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dc7e2c483af0b069004/5a6677dff9619afb6cbc03ca/1516664825724/DSC02809-50.jpg', 'PHYSICAL', '', 'SQ5725853', '', '', '', '', '', '', '0', '0'),
