(127, 'Mohawk+Hoodie', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E54%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3ECotton+Blend%26nbsp%3B%3C%2Fp%3E%3Cp+style%3D%22margin-left%3A0px%3B+margin-right%3A0px%22%3EHelmut+Lang+often+drew+inspiration+from+unlikely+sources+for+his+work.+Perhaps+the+best+demonstration+of+this+is+the+%C3%A2%E2%82%AC%C5%93Mohawk%C3%A2%E2%82%AC%C2%9D+hoodie+from+his+AW03+collection.+The+Mohawk+tribe%C3%A2%E2%82%AC%E2%84%A2s+namesake+hairstyle+became+an+integral+elects+of+2000s+popular+culture%2C+and+this+hooded+sweatshirt+from+Lang+features+one+the+hood.+Exaggerated+in+its+length%2C+it+is+constricted+of+horse+hair%2C+and+lends+an+aggressive+appearance+to+what+is+typically+considered+loungewear.%3C%2Fp%3E%3Cp%3EFits+true+to+size.%26nbsp%3B%3C%2Fp%3E', '14', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dc7e2c483af0b069004/5a8779a071c10b584594f270/1518827947219/DSC06510.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dc7e2c483af0b069004/5a87799fe4966ba44fab3d9b/1518827947367/DSC06511.jpg', 'PHYSICAL', '', 'SQ8940818', '', '', '', '', '', '', '0', '0'),
(128, 'Moon+Landing+Jacket', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E44%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E50%25+Cotton%2F35%25+Polyester%2F11%25+Acrylic%2F4%25+Other+Fibers%26nbsp%3B%3C%2Fp%3E%3Cp%3EHedi+Slimane%C3%A2%E2%82%AC%E2%84%A2s+SS16+%C3%A2%E2%82%AC%C5%93Surf+Sound%C3%A2%E2%82%AC%C2%9D+collection+was+inspired+by+Californian+surf+culture%2C+incorporating+elements+of+the+landscape+and+musical+scene.+This+jacket+is+one+of+the+most+sought+after+pieces+from+the+collection%2C+demonstrating+Slimane%C3%A2%E2%82%AC%E2%84%A2s+ability+to+inject+unexplected+elements+into+his+collections%3B+a+moon+landing+graphic+in+a+presentation+inspired+by+surfers.+The+fabric+has+a+substantial+weight%2C+allowing+the+vivid+image+to+be+displayed+without+much+distortion%2C+and+the+ribbing+inserts+feature+stripes+in+complementary+tones+of+brown+and+black.%3C%2Fp%3E%3Cp%3EFits+true+to+size.%26nbsp%3B%3C%2Fp%3E', '22', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a8777e4652deaeaab8b7dae/1518827508897/DSC06386.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a8777e49140b7effc989eb5/1518827508301/DSC06387.jpg', 'PHYSICAL', '', 'SQ2071550', '', '', '', '', '', '', '0', '0'),
