(181, 'Reversible+Velvet+Zip+Up+Hoodie', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3EXXS+%2B+XS%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E85%25+Cotton%2F15%25+Polyester%3C%2Fp%3E%3Cp%3EHaider+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+AW15+collection+was+shown+in+a+dimly+lit+setting%2C+with+the+intention+being+for+the+attendees+to+%C3%A2%E2%82%AC%C5%93smell+the+clothes%C3%A2%E2%82%AC%C2%9D+in+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+words.+Velvet+was+seen+in+abundance%2C+complementing+the+overall+dark+tone+of+the+presentation.+Few+designers+can+create+a+hooded+sweatshirt+that+is+describable+as+opulent%2C+yet+Ackermann+successfully+does+it%2C+as+illustrated+by+this+black+velour+version.+The+fabric+is+delightfully+soft%2C+complementing+the+garment%C3%A2%E2%82%AC%E2%84%A2s+oversized%2C+dropped+shoulder+cut.+A+washed+black+trim+runs+along+the+zipper%2C+hinting+at+the+interior+that+the+garment+can+be+reversed+to+in+order+to+create+a+more+pared+down+appearance.%3C%2Fp%3E%3Cp%3EFits+oversized.%26nbsp%3B%3C%2Fp%3E', '26', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a668bd10d92971bebc40cec/1516669906373/DSC03202_preview.jpeg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a668bd10852299e79919202/1516669906478/DSC03203_preview.jpeg', 'PHYSICAL', '', 'SQ0732195', '', '', '', '', '', '', '0', '0'),
(182, 'Ribbed+Drop+Crotch+Sweats', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3EXXS%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Cotton%3C%2Fp%3E%3Cp%3EAW14+was+Haider+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+second+attempt+at+a+menswear+collection%2C+deviating+strongly+from+the+decadent+silken+fabrics+that+were+expected+to+become+a+signature+of+his.+It+was+peppered+with+darker+tones+and+more+somber+patterns%2C+while+still+retaining+his+signature+proportions.+These+moss+green+sweatpants+feature+biker+clothing+inspired+ribbing+detailing%2C+something+Ackermann+has+flirted+with+on+several+occasions+in+his+menswear.+The+drop+crotch+complements+the+unfussy+nature+of+the+garment%2C+while+an+elastic+insert+on+the+inseams+creates+some+structure.%3C%2Fp%3E%3Cp%3EFits+relaxed.%26nbsp%3B%3C%2Fp%3E', '25', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a668a94e4966b0ac3b08fc7/1516669592265/DSC03247_preview.jpeg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a668a9471c10bf8dfeb3f9e/1516669592295/DSC03248_preview.jpeg', 'PHYSICAL', '', 'SQ5097742', '', '', '', '', '', '', '0', '0'),
