(200, 'Silk+Bomber+Jacket+', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3EM%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E51%25+Cotton%2F49%25+Viscose%3C%2Fp%3E%3Cp%3EHaider+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+SS15+collection+was+inspired+by+free+and+uninhibited+nature+of+musical+icons+like+Keith+Richards+and+Iggy+Pop.+The+show+was+punctuated+by+a+selection+of+opulent+fabrics%2C+injected+with+a+sense+of+edginess+that+was+atypical+of+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+work.+This+bomber+jacket+is+one+of+several+pieces+of+red+silken+outerwear+that+were+featured+in+the+collection.+The+torso+is+covered+in+a+chevron+pattern%2C+while+the+sleeves+feature+a+floral+pattern+that+was+almost+a+signature+of+the+show.+An+oversized+and+cropped+cut+complements+the+relaxed+nature+of+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+work%2C+while+the+striped+beige+ribbing+adds+an+element+of+contrast.%3C%2Fp%3E%3Cp%3EFits+oversized.%26nbsp%3B%3C%2Fp%3E', '24', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a66844f53450a2008900fb2/1516667996959/DSC02900-110.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a66845af9619a21f770895d/1516668005246/DSC02901-111.jpg', 'PHYSICAL', '', 'SQ3424595', '', '', '', '', '', '', '0', '0'),
(201, 'Silk+Dinner+Blazer', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E48%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Silk%3C%2Fp%3E%3Cp%3EHaider+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+SS17+collection+was+meant+to%2C+in+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+words%2C+capture+the+youthfulness+of+young+kids+who+%C3%A2%E2%82%AC%C5%93don%C3%A2%E2%82%AC%E2%84%A2t+have+the+heaviness+of+the+world%2C%C3%A2%E2%82%AC%C2%9D+and+even+the+tailoring+in+the+collection+was+injected+with+this+youthfulness.+A+lack+of+structure+is+the+first+detail+that+makes+this+apparent%2C+allowing+the+flowy+nature+of+the+silk+to+be+front+and+center%2C+and+the+use+of+contrast+detailing+draws+attention+to+the+wide+shawl+collared+lapel.%3C%2Fp%3E%3Cp%3EFits+small+to+size.%26nbsp%3B%3C%2Fp%3E', '30', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a668dee8165f59d849cdfe7/1516670459065/DSC02960-146_preview.jpeg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a668deef9619a21f772d85e/1530644989888/DSC02961-147_preview.jpeg', 'PHYSICAL', '', 'SQ8651208', '', '', '', '', '', '', '0', '0'),
(202, 'Silk+Print+Shirt+', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E39%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Silk%3C%2Fp%3E%3Cp%3EHaider+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+SS17+collection+was+meant+to%2C+in+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+words%2C+capture+the+youthfulness+of+young+kids+who+%C3%A2%E2%82%AC%C5%93don%C3%A2%E2%82%AC%E2%84%A2t+have+the+heaviness+of+the+world.%C3%A2%E2%82%AC%C2%9D+It+included+a+selection+of+brightly+patterned%2C+colorful+garments%2C+as+demonstrated+by+this+yellow+floral+print+shirt.+Constructed+from+a+breathable+and+matte+silk+fabric%2C+it+was+one+of+the+highlights+of+the+collection.+The+short+sleeves+feature+wide+cuffs+at+the+ends+that+are+intended+to+be+rolled+up+high+by+the+wearer%2C+in+a+manner+reminiscent+of+%C3%A2%E2%82%AC%C5%93kids+who+want+to+dance+and+party%C3%A2%E2%82%AC%C2%A6%C3%A2%E2%82%AC%C2%9D%3C%2Fp%3E%3Cp%3EFits+true+to+size.%26nbsp%3B%3C%2Fp%3E', '35', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a6687938165f59d849b5928/1516668845420/DSC02926-126.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a6687930d92971bebc30bd7/1516668843127/DSC02927-127.jpg', 'PHYSICAL', '', 'SQ0899793', '', '', '', '', '', '', '0', '0'),
