(204, 'Single+Layer+Crew+Neck', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3EXS+%2B+S%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Cotton%3C%2Fp%3E%3Cp%3EHaider+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+SS15+collection+was+inspired+by+free+and+uninhibited+nature+of+musical+icons+like+Keith+Richards+and+Iggy+Pop.+The+show+was+punctuated+by+a+selection+of+opulent+fabrics%2C+injected+with+a+sense+of+edginess+that+was+atypical+of+Ackermann%C3%A2%E2%82%AC%E2%84%A2s+work.+This+charcoal+toned+crewneck+is+one+of+the+more+pared+down+offerings+from+the+collection%2C+yet+is+still+distinctly+Ackermann+in+its+cut.+It+features+a+contrasting+back+panel+and+raglan+sleeves.%3C%2Fp%3E%3Cp%3EFits+oversized.%26nbsp%3B%3C%2Fp%3E', '21', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a668b0c419202ba47c5c83b/1516669709687/DSC03237_preview.jpeg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526e50419202e3243e83cb/5a668b0c53450a200891b1ee/1516669709739/DSC03238_preview.jpeg', 'PHYSICAL', '', 'SQ3011216', '', '', '', '', '', '', '0', '0'),
