(209, 'Small+Crash+Denim', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E30%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Cotton%3C%2Fp%3E%3Cp%3EThe+appeal+of+Hedi+Slimane%C3%A2%E2%82%AC%E2%84%A2s+denim+at+Saint+Laurent+lies+in+the+naturally+worn+in+nature+of+the+distressing.+Most+designer%C3%A2%E2%82%AC%E2%84%A2s+attempts+at+creating+authentic+looking+distressing+lead+to+garments+that+appear+thoroughly+contrived%2C+however+Slimane%C3%A2%E2%82%AC%E2%84%A2s+work+is+anything+but.+This+pair+of+heavily+washed+%22small+crash%22%26nbsp%3Bdenim+is+from+his+AW14+collection+for+the+house.+It+features+rips+through+the+knees+as+well+as+heavily+worn+hems+and+is+cut+in+the+house%27s+signature+D02+skinny+fit.%3C%2Fp%3E%3Cp%3EFits+skinny+through+the+leg.%26nbsp%3B%3C%2Fp%3E%3Cp%3EFits+skinny+through+the+leg.%26nbsp%3B%3C%2Fp%3E', '12', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a66960624a69492e7bbc796/1521854048902/DSC03227.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a669606f9619a21f774d256/1521854048902/DSC03228.jpg', 'PHYSICAL', '', 'SQ6787867', '', '', '', '', '', '', '0', '0'),
