(213, 'Sterling+Ruby+Camo+Long+Bomber', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E48%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Cotton%26nbsp%3B%3C%2Fp%3E%3Cp%3EFits+oversized.%26nbsp%3B%3C%2Fp%3E%3Cp+style%3D%22margin-left%3A0px%3B+margin-right%3A0px%22%3ERaf+Simons%C3%A2%E2%82%AC%E2%84%A2+AW14+collection+was+a+collaborative+effort+with+the+artist+Sterling+Ruby%2C+and+unlike+other+artist%2Fdesigner+collections%2C+Ruby+was+fully+engaged+in+the+9+year+long+process.+He+is+renowned+for+the+liberal+use+of+colors+in+his+work%2C+which+is+evident+on+this+garment+which+features+multicolored+stripes+at+the+hem+that+were+seen+on+several+pieces+of+outerwear+in+the+presentation+.+The+ribbing+on+the+neck+incorporates+the+%C3%A2%E2%82%AC%CB%9CAbus+Lang%C3%A2%E2%82%AC%E2%84%A2+and+%C3%A2%E2%82%AC%CB%9CFathers%C3%A2%E2%82%AC%E2%84%A2+motif%2C+with+the+former+meaning+%C3%A2%E2%82%AC%CB%9CAbusive+Language%C3%A2%E2%82%AC%E2%84%A2+and+the+latter%2C+in+Ruby%C3%A2%E2%82%AC%E2%84%A2s+words+highlighting+%22the+indoctrination+of+the+man%2C%22+which+is+further+echoed+in+the+military+inspired+camouflage+print.%3C%2Fp%3E', '21', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a877047c83025f59a3f11ad/1518825558856/DSC06488.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a877047e2c4831ac9fd62a3/1518825559294/DSC06489.jpg', 'PHYSICAL', '', 'SQ0469488', '', '', '', '', '', '', '0', '0'),
(214, 'Sterling+Ruby+Purple+Splatter+Jeans+', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E48%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Cotton%3C%2Fp%3E%3Cp+style%3D%22margin-left%3A0px%3B+margin-right%3A0px%22%3ERaf+Simons%C3%A2%E2%82%AC%E2%84%A2+AW14+collection+was+a+collaborative+effort+with+the+artist+Sterling+Ruby%2C+and+unlike+other+artist%2Fdesigner+collections%2C+Ruby+was+fully+engaged+in+the+9+year+long+process.+A+mainstay+of+Ruby%C3%A2%E2%82%AC%E2%84%A2s+work+is+the+use+of+splattered+fabrics%2C+often+seen+on+his+large+scale+canvases.+These+purple+denim+trousers+are+reminiscent+of+those+works%2C+featuring+white+splatters+all+over.%3C%2Fp%3E%3Cp%3EFit+is+straight+through+the+leg.%26nbsp%3B%3C%2Fp%3E', '25', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a87e6f59140b7effca8463a/1518855955815/DSC06558.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a87e6f541920223d04a1137/1518855954810/DSC06559.jpg', 'PHYSICAL', '', 'SQ3709246', '', '', '', '', '', '', '0', '0'),
(215, 'Stray+Souls+Patch+Crew+Neck', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E46%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Cotton%3C%2Fp%3E%3Cp+style%3D%22margin-left%3A0px%3B+margin-right%3A0px%22%3ERaf+Simons%27+SS02+%22Woe+Unto+Those+Who+Spit+on+the+Fear+Generation...%C3%A2%E2%82%AC%C2%9D%26nbsp%3Bwas+a+representation+of+the+scorned+youth+that+were+yearning+for+freedom.+The+collection+featured+several+garments+with+distressed+patches%2C+with+many+bearing+a+%C3%A2%E2%82%AC%C5%93Stray+Souls%2C+Pray+For+Us%C3%A2%E2%82%AC%C2%9D+graphic+that+is+seen+here+on+a+sweatshirt.+Echoing+the+disheveld+ppearance+of+the+collection%2C+it+features+a+raw+hem+and+cutoff+sleeves.%3C%2Fp%3E%3Cp%3EFits+true+to+size.%26nbsp%3B%3C%2Fp%3E', '14', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a87c2e4e4966ba44fb7307d/1518846697410/DSC06530+2.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a87709eec212d1cb44cd434/1518846680093/DSC06531.jpg', 'PHYSICAL', '', 'SQ8364183', '', '', '', '', '', '', '0', '0'),
(216, 'Striped+Oversized+Varsity+Sweater+%22P%22', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3EOS%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Wool%26nbsp%3B%3C%2Fp%3E%3Cp+style%3D%22margin-left%3A0px%3B+margin-right%3A0px%22%3ERaf+Simons%C3%A2%E2%82%AC%E2%84%A2+AW16+%C3%A2%E2%82%AC%C5%93Nightmares+and+Dreams%C3%A2%E2%82%AC%C2%9D+collection+paid+homage+to+the+designer+that+first+prompted+him+to+take+up+fashion+design%2C+Martin+Margiela.+The+inspiration+was+most+evident+in+his+use+of+oversized+distressed+knitwear+with+collegiate+patches%2C+which+were+seen+throughout+the+show.+This+blue+sweater+features+a+V-neck+with+a+collegiate+style+%C3%A2%E2%82%AC%C5%93P%C3%A2%E2%82%AC%C2%9D+patch%2C+as+well+as+white+varsity+style+stripes+on+the+neck%2C+sleeves%2C+and+hem.+The+generous+ribbed+cuffs+are+asymmetrically+constructed%2C+and+contrast+stitching+can+be+seen+on+the+sleeves+and+torso.%3C%2Fp%3E%3Cp%3EFits+oversized.%26nbsp%3B%3C%2Fp%3E', '33', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a87747c53450a6552c0b3b8/1518826653303/DSC06499.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a526dbec830256b61a08dc1/5a87747c41920223d039cb7b/1518826652508/DSC06500.jpg', 'PHYSICAL', '', 'SQ7099595', '', '', '', '', '', '', '0', '0'),
