(219, 'Suede+Denim+Jacket+', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3E50%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Goatskin%3C%2Fp%3E%3Cp%3EFW16+was+Hedi+Slimane%C3%A2%E2%82%AC%E2%84%A2s+final+collection+for+Saint+Laurent%2C+and+garments+like+this+suede+trucker+jacket+are+a+reminder+as+to+why+he+remains+so+highly+regarded.+The+luxurious+goatskin+construction+uproots+the+jacket+from+its+hardy+workwear+roots%2C+placing+it+in+the+dark+glamorous+world+of+his+final+collection+for+the+house.+In+classical+Slimane+fashion%2C+the+jacket+is+cut+slim+and+cropped%2C+with+high+armholes.%3C%2Fp%3E%3Cp%3EFits+small+to+size.%26nbsp%3B%3C%2Fp%3E', '30', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a6691938165f59d849dbcab/1522014730243/DSC03155.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a6691930d92971bebc56eed/1522014730242/DSC03156.jpg', 'PHYSICAL', '', 'SQ7673178', '', '', '', '', '', '', '0', '0'),
