(260, 'Wool+Flannel+', '', '', '%3Cp%3E%3Cstrong%3ESize%3A%26nbsp%3B%3C%2Fstrong%3EF40%3C%2Fp%3E%3Cp%3E%3Cstrong%3EMaterial%3A%26nbsp%3B%3C%2Fstrong%3E100%25+Virgin+Wool%3C%2Fp%3E%3Cp%3EHedi+Slimane+featured+a+plethora+of+flannel+shirts+in+his+shows+for+Saint+Laurent%2C+yet+none+are+as+coveted+as+the+first+edition+from+his+debut+FW13+collection.+It+is+constructed+of+a+substantial+blue+tartan+plaid+wool+fabric%2C+with+two+button+flap+chest+pockets.+The+yoke+features+a+box+pleat%2C+in+addition+to+a+slouchy+fit+in+the+body.%3C%2Fp%3E%3Cp%3EFits+oversized.%3C%2Fp%3E%3Cp%3E%C2%A0%3C%2Fp%3E', '10', 'https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a6685dd71c10bf8dfea1d2f/1516668408966/DSC02910-118.jpg, https://static1.squarespace.com/static/5a51080532601e936558a1a0/5a52661c53450aea171de7f7/5a6685dde4966b0ac3af6a50/1516668408946/DSC02911-119.jpg', 'PHYSICAL', '', 'SQ3894058', '', '', '', '', '', '', '0', '0'),
